import React from 'react';
import { Box, Grid, Typography, button} from '@material-ui/core'

const skills = ["Javascript","React.js","Node.js"];

export default props =>{
 return(
    <Box>
        <Grid container>
            <Grid item xs>
                <Typography variant="subtitle1">Frontend</Typography>
                <Typography varinat="subtitle2">Google</Typography>
            </Grid>
            <Grid item container xs>
                {skills.map(skill => (
                    <Grid key={skill} item>
                        {skill}
                    </Grid>
                ))}
            </Grid>
            <Grid item xs>
                <Typography>2577 min ago | Full time | Remote</Typography>
                <Button> </Button>
            </Grid>

        </Grid>
    </Box>
 )
}
